const ProductInfoListIcon = () => {
  return (
    <svg
      focusable="false"
      className="css-e75gge-icon themed-icon"
      viewBox="0 0 11 10"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M1 7L4 9L10 1.5"
        stroke="#212224"
        strokeWidth="1.25"
        strokeLinecap="round"
        strokeLinejoin="round"
      ></path>
    </svg>
  );
};

export default ProductInfoListIcon;
